import React from "react";
import Dashboard from "./components/Dashboard";
import DataTables from "./components/DataTables";
import DatePicker from "./components/DatePicker";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AdminVerification from "./components/subcomponents/login/Divider";
import Landing from "./components/subcomponents/landing/LandingTemp";
import SuccessDisplay from "./components/subcomponents/admin/Upgrade";

function App() {
  const routes = [
    {
      path: "/",
      exact: true,
      main: <Landing />,
    },
    {
      path: "/admin-verification",
      exact: true,
      main: <AdminVerification />,
    },
    {
      path: "/dashboard",
      exact: true,
      main: <Dashboard />,
    },
    {
      path: "/data-tables",
      main: <DataTables />,
    },
    {
      path: "/subscription",
      main: <SuccessDisplay />,
    },
    {
      path: "/date-picker",
      main: <DatePicker />,
    },
  ];

  return (
    <Router>
      <Routes>
        {routes.map((route, index) => (
          <Route
            key={index}
            path={route.path}
            element={route.main}
            exact={route.exact}
          />
        ))}
      </Routes>
    </Router>
  );
}

export default App;
